function numSuf(t){var r=t.toString().length-1,e=t.toString().substring(r);switch(e){case"1":return"st";case"2":return"nd";case"3":return"rd";default:return"th"}}function log(t){console.log(t)}function msg(t){alert(t)}function capitalizeFirstCharacter(t){var r=null,e="";if("id"===t.trim().toLowerCase()||"ssn"===t.trim().toLowerCase()||"sku"===t.trim().toLowerCase()||"vm"===t.trim().toLowerCase()||"mac"===t.trim().toLowerCase()||"imei"===t.trim().toLowerCase()||"os"===t.trim().toLowerCase()||"atm"===t.trim().toLowerCase()||"pa"===t.trim().toLowerCase())t=t.toUpperCase();else if(t.match(/[-]/)){if(null!==(r=t.split(["-"])).length>0){for(var s=0;s<r.length;s++)e+=s<r.length-1?r[s].substring(0,1).toUpperCase()+r[s].substring(1)+"-":r[s].substring(0,1).toUpperCase()+r[s].substring(1);return e}}else{if(!t.match(/[ ]/))return t.substring(0,1).toUpperCase()+t.substring(1);if(null!==(r=t.split([" "])).length>0){for(var s=0;s<r.length;s++)e+=s<r.length-1?r[s].substring(0,1).toUpperCase()+r[s].substring(1)+" ":r[s].substring(0,1).toUpperCase()+r[s].substring(1);return e}}return t}function cfc(t){return capitalizeFirstCharacter(t)}